import React from 'react';
import {View,Text,TouchableOpacity,Button,SafeAreaView} from 'react-native';
import {css} from '../assets/Css/css';

export default function Teste2 (props1) {
   
    return (
            <View style = {css.container2}>
                <Text>Test2</Text>
            </View>
    );
    
}
